import React,{useEffect,useState} from "react";
import { response } from "express";



function App() {
  const[Home,setHome] = useState([{}]);
  useEffect(()=>{
    fetch("/home".then(
      response => response.json()
    ).then(
      data => {
        setHome(data)
      }
    )
    )
  })



  return (
  <div>

  </div>
  );
}

export default App;
